  SELECT id_pn INTO vn_id_pn FROM jp_konf_n WHERE parametr = 'AUMS_GUI_MENU';
  vn_id_param_def := -1;
  vn_id_param_wart := -1;
  
  SELECT NVL((SELECT 1 FROM jp_konf_def WHERE id_param = (SELECT id_param FROM jp_konf_def d JOIN jp_konf_params p ON d.id_pn=p.id_pn AND d.id_def=p.id_def WHERE d.id_pn=vn_id_pn AND ROWNUM = 1)), 0)
    INTO exists_JP_KONF_DEF_id_param FROM dual;
  IF (exists_JP_KONF_DEF_id_param = 1) THEN
    SELECT id_param INTO vn_id_param_def FROM jp_konf_def d JOIN jp_konf_params p ON d.id_pn=p.id_pn AND d.id_def=p.id_def WHERE d.id_pn=vn_id_pn;
  END IF;

  SELECT NVL((SELECT 1 FROM jp_konf_wart WHERE id_param = (SELECT id_param FROM jp_konf_def d JOIN jp_konf_params p ON d.id_pn=p.id_pn AND d.id_def=p.id_def WHERE d.id_pn=vn_id_pn AND ROWNUM = 1)), 0)
    INTO exists_JP_KONF_WART_id_param FROM dual;
  IF (exists_JP_KONF_WART_id_param = 1) THEN
    SELECT id_param INTO vn_id_param_wart FROM jp_konf_def d JOIN jp_konf_params p ON d.id_pn=p.id_pn AND d.id_def=p.id_def WHERE d.id_pn=vn_id_pn;
  END IF;
  
  IF(vn_id_param_def > -1 AND vn_id_param_wart > -1) THEN
    UPDATE jp_konf_wart SET wart_bin = encrypted_json_blob_value WHERE id_param = vn_id_param_wart;
    COMMIT;
  END IF;

  IF(vn_id_param_def > -1 AND vn_id_param_wart = -1) THEN
    INSERT INTO jp_konf_wart (id_param, wart_bin) VALUES (vn_id_param_def, encrypted_json_blob_value);
    COMMIT;
  END IF;

  IF(vn_id_param_def = -1 AND vn_id_param_wart = -1) THEN
    SELECT MAX(id_param) + 1 INTO vn_id_param_new FROM jp_konf_def;
    SELECT id_def INTO vn_id_def FROM jp_konf_params WHERE id_pn=vn_id_pn;
    INSERT INTO jp_konf_def (id_param, id_def, id_pn, wart_param, priorytet) VALUES (vn_id_param_new, vn_id_def, vn_id_pn, 'J2', 10);
    INSERT INTO jp_konf_wart (id_param, wart_bin) VALUES (vn_id_param_new, encrypted_json_blob_value);
    COMMIT;
  END IF;

